/*Por ejemplo, el primer paso sería utilizar un objeto para realizar agregaciones, es decir
comenzar con un objeto vacío y extenderlo a medida que se encuentren registros nuevos.
El segundo paso sería obtener el resultado del paso uno, recorrer sus keys y por cada key
agregar un objeto nuevo al resultado final (un array).*/


  
  
  function recorreArr(arr){
  
     var arrElemento=[];
     var bancosYCajeros={};
     
   

      for(var i=0; i < arr.length; i++){
        arrElemento= arr[i].split(';');
        var bancoNombre = arrElemento[0];
        var cantidadCajeros = Number(arrElemento[3]);

           if(bancosYCajeros[bancoNombre] === undefined){
             
              bancosYCajeros[bancoNombre] = cantidadCajeros;
          } else {

          	  bancosYCajeros[bancoNombre] += cantidadCajeros; 
          		}

           }

        
      return bancosYCajeros;           
      
  }



    function devuelveArray(obj){

    	var arrResultado=[];
    	var arrKeys= Object.keys(obj);
  		
    	for(var i=0; i< arrKeys.length ; i++){
             
             var bancos = {name: arrKeys[i], value: obj[arrKeys[i]]};

             arrResultado.push(bancos);
   	
    	}

    	return arrResultado;

    }
